  return (
    <div className="container">
    <h1>{props.heading}</h1>
    <p className="lead">
      ჩვენი საიტები ყველას ჯობია, ყველაფრით. მარტო ფეისბუქი გვჯობია ოდნავ
    </p>
    <p className="btn btn-primary" onClick={alert("itanamshromle")}>
      ითანამშრომლეთ ჩვენთან
      </p> 
  </div>
  );
}
